import{createInstance}from"../keyword/create-instance.min.js";import{Buildable}from"../interface/buildable.min.js";import{QualificationModel}from"../model/qualification-model.min.js";import{Utility}from"../shared/utility.min.js";import{PageColorAdjuster}from"../shared/page-color-adjuster.min.js";import ScriptSeriesLoader from"../shared/script-series-loader.min.js";import StylesheetSeriesLoader from"../shared/stylesheet-series-loader.min.js";class QualificationController extends Buildable{constructor(){super(),this.model=new QualificationModel,this.scriptLoader=ScriptSeriesLoader,this.scriptLoader.add("https://ajax.googleapis.com/ajax/libs/jquery/3.3.1/jquery.min.js"),this.scriptLoader.load(),this.stylesheetLoader=StylesheetSeriesLoader,this.stylesheetLoader.add("css/destyle.min.css"),this.stylesheetLoader.add("css/restyle.min.css"),this.stylesheetLoader.add("css/common.min.css"),this.stylesheetLoader.add("css/qualification.min.css"),this.stylesheetLoader.load()}static build=async()=>{const e=new QualificationController;for(;e.scriptLoader.running||e.stylesheetLoader.running;)await Utility.sleep(2e3);return e};execute=async()=>{const e=this.model.getQualifications();for(const s of e)$("div#qualification").append(`<p>${s.name} ${s.score}</p>`);(await createInstance(PageColorAdjuster)).changeBackgroundColor()}}export{QualificationController};